import React, { useState } from "react";
import MemberShow from "../Component/MemberShow";
import img from "../SourceFiles/Header/male.png";

function Members() {
  const [Members, setMembers] = useState([
    {
      id: 1,
      name: "person1",
      lastname: "lastname",
      age: "age",
      university: "uni",
      speciality: "speciality",
      degree: "degree",
      department: "department",
      activity: "activ",
    },
    {
      id: 2,
      name: "person2",
      lastname: "lastname",
      age: "age",
      university: "uni",
      speciality: "speciality",
      degree: "degree",
      department: "department",
      activity: "activ",
    },
    {
      id: 3,
      name: "person3",
      lastname: "lastname",
      age: "age",
      university: "uni",
      speciality: "speciality",
      degree: "degree",
      department: "department",
      activity: "activ",
    },
    {
      id: 4,
      name: "person4",
      lastname: "lastname",
      age: "age",
      university: "uni",
      speciality: "speciality",
      degree: "degree",
      department: "department",
      activity: "activ",
    },
    {
      id: 5,
      name: "person5",
      lastname: "lastname",
      age: "age",
      university: "uni",
      speciality: "speciality",
      degree: "degree",
      department: "department",
      activity: "activ",
    },
  ]);

  const [MemberId, setMemberId] = useState(1);

  const [MemberData, setMemberData] = useState({
    id: 1,
    name: "person1",
    lastname: "lastname",
    age: "age",
    university: "uni",
    speciality: "speciality",
    degree: "degree",
    department: "department",
    activity: "activ",
  })



  return (
    <div id="members">
      <div id="members-block" className="container flex">
        <MemberShow />
        <div id="member-list">
          <div id="member-list-block">
            <ul className="flex">
              {Members.map((item) => {
                return (
                  <li className="flex" onClick = {
                      ()=> {
                          setMemberId(item.id)
                      }
                  }>
                    <div className="img flex">
                      <img src={img} />
                    </div>
                    <div className="member-data flex">
                      <h4>{item.name}</h4>
                      <span>{item.department}</span>
                    </div>
                  </li>
                );
              })}
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Members;
